// (1, 'Resident Evil 4', 'Capcom', '2023-03-24', '"Resident Evil 4" thrusts players into a nightmarish world of survival horror as Leon S. Kennedy, tasked with rescuing the President''s daughter from a sinister cult in rural Europe. With its groundbreaking third-person perspective, intense action, and atmospheric environments, Resident Evil 4 revolutionized the survival horror genre. Navigate through intricate puzzles, confront grotesque creatures, and unravel a chilling conspiracy in this iconic installment of the acclaimed ', 'resident-evil-4-2023', 'https://media.rawg.io/media/games/51a/51a404b9918a0b19fc704a3ca248c69f.jpg', '', 4.61, 94, '["https://media.rawg.io/media/games/51a/51a404b9918a0b19fc704a3ca248c69f.jpg","https://media.rawg.io/media/screenshots/33d/33dbe045a82988878cd865b80fcc6269.jpg","https://media.rawg.io/media/screenshots/cdd/cdd81f8b87c0352e20ab9f8eefba7ddb.jpg","https://media.rawg.io/media/screenshots/a73/a739f3814e9d57228bd6cdd406012911.jpg","https://media.rawg.io/media/screenshots/44a/44a9d54fefbef2e21e6b3b8c1c54546b.jpg"]', '2024-05-12 05:00:34.812722', '2024-05-19 22:02:40.627984'),
//             (2, 'The Last of Us Part II', 'Naughty Dog', '2020-06-19', '"The Last of Us Part II" immerses players in a post-apocalyptic world fraught with peril and moral ambiguity. Navigate through the ruins of civilization as Ellie, confronting both the infected and human adversaries alike. With its gripping narrative, visceral combat, and stunning visuals, TLOU 2 delivers an emotionally resonant journey that challenges your perceptions of right and wrong in a world consumed by darkness.', 'the-last-of-us-part-2', 'https://media.rawg.io/media/games/909/909974d1c7863c2027241e265fe7011f.jpg', 'https://youtu.be/btmN-bWwv0A?si=oQgTW3OFx87Kprom', 5.00, 93, '["https://media.rawg.io/media/games/909/909974d1c7863c2027241e265fe7011f.jpg","https://media.rawg.io/media/screenshots/5a8/5a8f06949b0264aa27374d3f005a2842.jpg","https://media.rawg.io/media/screenshots/160/1603055e1fc4fbbea395809242d23c67_CDpXDx3.jpg","https://media.rawg.io/media/screenshots/e9c/e9cfbbc7821827e04c890ecf087c246c.jpg","https://media.rawg.io/media/screenshots/e58/e58f17219570ca451356f6eec746e697.jpg","https://media.rawg.io/media/screenshots/02a/02aede3e5e6738e37ff1240c1c2fcee8.jpg","https://media.rawg.io/media/screenshots/5ea/5ea913f25ebb5454571e8d92deddebcc.jpg"]', '2024-05-12 05:01:50.58585', '2024-05-17 21:35:13.711893'),
//             (3, 'Resident Evil 2', 'Capcom', '2019-01-25', 'Resident Evil 2" immerses players in the heart of Raccoon City, overrun by hordes of zombies and other terrifying creatures unleashed by the deadly T-virus. Play as rookie cop Leon Kennedy or college student Claire Redfield as they fight for survival and uncover the dark secrets of the Umbrella Corporation. With its tense atmosphere, strategic gameplay, and immersive storytelling, Resident Evil 2 delivers an unforgettable survival horror experience that redefined the genre.', 'resident-evil-2-2019', 'https://media.rawg.io/media/games/053/053fc543bf488349610f1ae2d0c1b51b.jpg', '', 4.50, 91, '["https://media.rawg.io/media/games/053/053fc543bf488349610f1ae2d0c1b51b.jpg","https://media.rawg.io/media/screenshots/9e6/9e6e83b37dfd176eab77a829c5c7a109.jpg","https://media.rawg.io/media/screenshots/ca6/ca6629a8a4565b8ae7816ffcb4d38657.jpg","https://media.rawg.io/media/screenshots/df4/df450d260b14fb77ac238d77fe98746d.jpg","https://media.rawg.io/media/screenshots/fac/facb42731a6cc48e8fdfaef995f3ed71.jpg","https://media.rawg.io/media/screenshots/4bf/4bf2b3c6822715ec3b01882e0cf97572.jpg","https://media.rawg.io/media/screenshots/bdb/bdbf60136aad78a718679d2f1ac317f9.jpg"]', '2024-05-12 05:02:32.352482', '2024-05-12 05:02:32.352482'),
//             (4, 'Uncharted 4: A Thief’s End', 'Naughty Dog', '2016-05-10', '"Uncharted 4: A Thief''s End" takes players on a thrilling adventure across exotic landscapes and treacherous terrain. Join Nathan Drake on his final quest as he delves into the mysteries of his past and confronts his greatest challenge yet. With its breathtaking visuals, exhilarating action sequences, and compelling storytelling, Uncharted 4 delivers an unforgettable journey filled with danger, discovery, and redemption.', 'uncharted-4-a-thiefs-end', 'https://media.rawg.io/media/games/709/709bf81f874ce5d25d625b37b014cb63.jpg', '', 4.51, 99, '["https://media.rawg.io/media/games/709/709bf81f874ce5d25d625b37b014cb63.jpg","https://media.rawg.io/media/screenshots/fd5/fd5451e27048c3e416de1737047e4684.jpg","https://media.rawg.io/media/screenshots/63f/63f551c55bb44ec41dbcab6898cdd264.jpg","https://media.rawg.io/media/screenshots/30b/30bfd42d8bfe46301dbef56ba526b3ed.jpg","https://media.rawg.io/media/screenshots/fd2/fd2ae2bc22f4fefeeb6f4b6f1587e128.jpg","https://media.rawg.io/media/screenshots/66c/66c2aecdd80e940ea7a2d64c17cff843.jpg","https://media.rawg.io/media/screenshots/89c/89c96f28e032d3434bab7b9247e01fe3.jpg"]', '2024-05-12 05:03:19.018575', '2024-05-17 21:35:59.851093'),
//             (5, 'Hitman', 'IOI Interactive', '2016-03-11', '"Hitman" puts players in the sleek shoes of Agent 47, a professional assassin navigating a world of intrigue and deception. With its sandbox-style levels and emphasis on creativity, players can approach each mission with their own style and strategy. Whether you prefer stealthy takedowns or all-out action, Hitman offers a thrilling and immersive experience that will test your skills as the ultimate contract killer.', 'hitman', 'https://media.rawg.io/media/games/16b/16b1b7b36e2042d1128d5a3e852b3b2f.jpg', '', 3.92, 83, '["https://media.rawg.io/media/games/16b/16b1b7b36e2042d1128d5a3e852b3b2f.jpg","https://media.rawg.io/media/screenshots/ef6/ef6c0a92d08a99d2e405cac53c597d10.jpg","https://media.rawg.io/media/screenshots/fb3/fb3c23014fcb24a28fb94af0a009906c.jpg","https://media.rawg.io/media/screenshots/202/202293192d1b6245c8a1e252d9df604c.jpg","https://media.rawg.io/media/screenshots/278/278bd63ee564982e816ec7fe802df420.jpg","https://media.rawg.io/media/screenshots/002/0021b0e5db6959989d90979abba68c8d.jpg","https://media.rawg.io/media/screenshots/c8a/c8a537532ab8ce8750293a1fc41ee7f8.jpg"]', '2024-05-12 05:03:51.74247', '2024-05-12 05:03:51.74247'),
//             (6, 'God of War (2018)', 'SantaMonica Studio', '2018-04-20', 'Unleash the fury of Kratos in ''God of War'' (2018), a breathtaking reimagining of the iconic series. Journey alongside Kratos and his son Atreus through the treacherous realms of Norse mythology, as they embark on a deeply personal quest. With stunning visuals, immersive storytelling, and brutal combat, experience the epic tale of a father and son bound by tragedy, seeking redemption in a world teetering on the brink of chaos.', 'god-of-war-2', 'https://media.rawg.io/media/games/4be/4be6a6ad0364751a96229c56bf69be59.jpg', '', 4.56, 94, '["https://media.rawg.io/media/games/4be/4be6a6ad0364751a96229c56bf69be59.jpg","https://media.rawg.io/media/screenshots/d68/d6868e5f7bce66e326bd48b11ba24b13.jpeg","https://media.rawg.io/media/screenshots/928/928cdaf4ae204f202d177bbd65e911b3.jpeg","https://media.rawg.io/media/screenshots/a54/a549a06ebe89c570cabb57308c4c42a5.jpeg","https://media.rawg.io/media/screenshots/f02/f0279f8199da3e91134078e737e5fbcf.jpg","https://media.rawg.io/media/screenshots/e87/e87c57660c7c37fe973c6dd6ebcc1ac6.jpeg","https://media.rawg.io/media/screenshots/5b7/5b7280fe437c39d3ce501a867c46a998.jpeg"]', '2024-05-13 18:16:41.173285', '2024-05-13 18:16:41.173285'),
//             (8, 'Star Wars Jedi: Fallen Order', ' Electronic Arts', '2019-11-15', 'A galaxy-spanning adventure awaits in Star Wars Jedi: Fallen Order, a new third-person action-adventure title from Respawn Entertainment. This narratively driven, single-player game puts you in the role of a Jedi Padawan who narrowly escaped the purge of Order 66 following the events of Episode 3: Revenge of the Sith. On a quest to rebuild the Jedi Order, you must pick up the pieces of your shattered past to complete your training, develop new powerful Force abilities and master the art of the iconic lightsaber - all while staying one step ahead of the Empire and its deadly Inquisitors.', 'jedi-the-fallen-order', 'https://media.rawg.io/media/games/559/559bc0768f656ad0c63c54b80a82d680.jpg', '', 4.14, 80, '["https://media.rawg.io/media/games/559/559bc0768f656ad0c63c54b80a82d680.jpg","https://media.rawg.io/media/screenshots/1c0/1c0016ec0441e86648bd7f751c8e5adf.jpg","https://media.rawg.io/media/screenshots/4fd/4fd551e67bc9fd9eb4c855604838d10f.jpg","https://media.rawg.io/media/screenshots/dd6/dd69cc02ef3d56dabbe62f06ddea8569.jpg","https://media.rawg.io/media/screenshots/b2c/b2cdb1843349dd5db358a4b214a00f2c.jpg","https://media.rawg.io/media/screenshots/c60/c6065f618a7304016db7fa02d563084a_rSIdAmV.jpg","https://media.rawg.io/media/screenshots/99f/99f9710b7305817f44866b7a61b77dd0.jpg"]', '2024-05-16 03:53:24.538537', '2024-05-16 03:53:24.538537'),
//             (17, 'Cyberpunk 2077', 'CD ProjectsRed', '2020-12-10', 'Dive into the neon-lit streets of Night City in ''Cyberpunk 2077'', a sprawling open-world RPG set in a dystopian future. Play as V, a mercenary outlaw equipped with cybernetic enhancements, as you navigate a city filled with violence, intrigue, and opportunity. Customize your character''s appearance, abilities, and playstyle as you forge alliances, take on missions, and uncover the dark secrets lurking beneath the surface. With its deep narrative, immersive world-building, and stunning visuals, Cyberpunk 2077 offers an unforgettable journey into the heart of cyberpunk fiction.', 'cyberpunk-2077', 'https://media.rawg.io/media/games/26d/26d4437715bee60138dab4a7c8c59c92.jpg', '', 4.17, 73, '["https://media.rawg.io/media/games/26d/26d4437715bee60138dab4a7c8c59c92.jpg","https://media.rawg.io/media/screenshots/814/814c25d6fd1fd34a4e6dade645a3bda7.jpg","https://media.rawg.io/media/screenshots/2ab/2ab0b67e68b6ede6b19d80094b6f7f2a_qTSfS2g.jpg","https://media.rawg.io/media/screenshots/cd2/cd22af9d6ac593440defac6082760e4a.jpg","https://media.rawg.io/media/screenshots/9b5/9b51535beb9d9e416cb9aac874091334.jpg","https://media.rawg.io/media/screenshots/d84/d84d3a16c1e2cb24dcf73e0108d78455.jpg","https://media.rawg.io/media/screenshots/a55/a5583c11e4fd11a9eb5d52e8ddd41ac3.jpg"]', '2024-05-17 20:35:42.108901', '2024-05-17 20:35:42.108901'),
//             (18, 'Batman: Arkham Knight', 'WB Games', '2015-06-23', 'Join the Dark Knight in his final chapter as Gotham faces its greatest threat in ''Batman: Arkham Knight''. Take to the streets of a besieged Gotham City, where Scarecrow and the mysterious Arkham Knight wreak havoc. Utilize the Batmobile and Batman''s formidable combat skills to overcome adversaries and unravel the sinister plot threatening the city. With stunning visuals, immersive gameplay, and a gripping narrative, Arkham Knight delivers the ultimate Batman experience."', 'batman-arkham-knight', 'https://media.rawg.io/media/games/310/3106b0e012271c5ffb16497b070be739.jpg', '', 4.24, 81, '["https://media.rawg.io/media/games/310/3106b0e012271c5ffb16497b070be739.jpg","https://media.rawg.io/media/screenshots/1ed/1ed7f33789fdb79dbe7ae346f7b24fdf.jpg","https://media.rawg.io/media/screenshots/c19/c19a4d55f1fa9661b32d43e110a5dbff.jpg","https://media.rawg.io/media/screenshots/b87/b873d09e51115514cb1445a954dbca9e.jpg","https://media.rawg.io/media/screenshots/cbe/cbee51d83cafbe75224336859ddfc27e.jpg","https://media.rawg.io/media/screenshots/d2a/d2ab2d0f10e778c1a867c999515c3f9a.jpg","https://media.rawg.io/media/screenshots/172/172a4d61d4b6d3b77f19f5826de439f2.jpg"]', '2024-05-17 20:36:31.842608', '2024-05-17 20:36:31.842608'),
//             (19, 'Assassin''s Creed Valhalla', 'Ubisoft', '2020-11-10', 'Embark on a legendary Viking journey in ''Assassin''s Creed Valhalla''. Play as Eivor, a fierce Viking raider, as you lead your clan from the harsh shores of Norway to the lush lands of ninth-century England. Forge alliances, build your settlement, and conquer territories in an expansive open world filled with dynamic quests and brutal combat. With rich storytelling, stunning visuals, and deep customization, Valhalla immerses you in the epic saga of Viking warfare and exploration.', 'assassins-creed-valhalla', 'https://media.rawg.io/media/games/934/9346092ae11bf7582c883869468171cc.jpg', '', 3.72, 82, '["https://media.rawg.io/media/games/934/9346092ae11bf7582c883869468171cc.jpg","https://media.rawg.io/media/screenshots/40d/40d4c5e37758450905c985918ab6ea11.jpg","https://media.rawg.io/media/screenshots/c5b/c5b052449f59eb31a0dcf01967d0715b.jpg","https://media.rawg.io/media/screenshots/0fa/0fab0247d40f79a2f35fe8143dc438ec.jpg","https://media.rawg.io/media/screenshots/50e/50efcd7fdd2967ddd73c9911985339dc.jpg","https://media.rawg.io/media/screenshots/4c4/4c4e1c1079b11760d07847f83cc1a2a8.jpg","https://media.rawg.io/media/screenshots/a07/a07f4c2dab611d69357f20f32435b1a2.jpg"]', '2024-05-17 21:30:41.212567', '2024-05-17 21:30:41.212567'),
//             (20, 'Assassin''s Creed Syndicate', 'Ubisoft', '2015-10-13', 'Take back the streets of Industrial Revolution-era London in ''Assassin''s Creed Syndicate''. Play as twin Assassins, Jacob and Evie Frye, as you fight to liberate the city from the grip of the Templars. Navigate the gritty urban landscape using advanced parkour, engage in dynamic combat, and lead your gang to overthrow corrupt officials. With its rich historical setting, diverse gameplay mechanics, and compelling narrative, Syndicate delivers a thrilling adventure in the heart of Victorian London.', 'assassins-creed-syndicate-2', 'https://media.rawg.io/media/games/9f1/9f189c639f70f91166df415811a8b525.jpg', '', 3.67, 74, '["https://media.rawg.io/media/games/9f1/9f189c639f70f91166df415811a8b525.jpg","https://media.rawg.io/media/screenshots/578/57836521fc9d7f0a5b743c5d3aabbac2.jpg","https://media.rawg.io/media/screenshots/240/2402b360498dc27ac594774a968e028f.jpg","https://media.rawg.io/media/screenshots/cdd/cdda74e097646eda1ae8c87c46942530.jpg","https://media.rawg.io/media/screenshots/6cb/6cb68bc408c6c0e4e0f1b2782ad03e86.jpg","https://media.rawg.io/media/screenshots/b90/b909dc646a468a33b1a5e9d97fb2b979.jpg","https://media.rawg.io/media/screenshots/82f/82fe6e74ec918f4c7c0df69cd991a04b.jpg"]', '2024-05-17 21:31:18.326549', '2024-05-17 21:36:25.654406'),
//             (21, 'Syberia: The World Before', 'Microids Studio', '2022-03-18', 'Embark on an enchanting journey in ''Syberia: The World Before''. Follow the intertwined destinies of Kate Walker and Dana Roze across different eras as you explore stunning landscapes and unravel intricate puzzles. Set against the backdrop of war and mystery, immerse yourself in a rich narrative filled with emotional depth and captivating characters. With its beautiful artistry and engaging gameplay, Syberia: The World Before offers an unforgettable adventure through time and imagination.', 'syberia-the-world-before', 'https://media.rawg.io/media/games/067/067df4bb30f618958ffc58ad8e3b0a38.jpg', '', 3.92, 80, '["https://media.rawg.io/media/games/067/067df4bb30f618958ffc58ad8e3b0a38.jpg","https://media.rawg.io/media/screenshots/fcd/fcda2519866ca4a0ed131c72ff58cb54.jpg","https://media.rawg.io/media/screenshots/6a9/6a94b81097b01559e779b9b15a7a4cf6.jpg","https://media.rawg.io/media/screenshots/00d/00d88a509b836e73b95799efdec54cb9.jpg","https://media.rawg.io/media/screenshots/c4c/c4c4ce8f231a250e3687b372cb8b5b80.jpg","https://media.rawg.io/media/screenshots/76a/76a05911b4335eeae49f5435f3dc5369.jpg","https://media.rawg.io/media/screenshots/f47/f47a0af6c29929ec055dc04ef4244f7e.jpg"]', '2024-05-18 18:52:18.015886', '2024-05-18 18:52:18.015886'),
//             (22, 'Grand Theft Auto V', 'RockStar', '2013-09-17', 'Experience the sprawling open world of Los Santos in ''Grand Theft Auto V''. Play as three distinct characters—Michael, Franklin, and Trevor—as their lives intertwine in a series of daring heists and explosive missions. Explore a vibrant city filled with diverse activities, from high-speed chases and heists to golfing and stock trading. With its engaging storyline, vast open world, and extensive multiplayer mode, GTA V offers an unparalleled gaming experience of crime and chaos.', 'grand-theft-auto-v', 'https://media.rawg.io/media/games/20a/20aa03a10cda45239fe22d035c0ebe64.jpg', '', 4.47, 92, '["https://media.rawg.io/media/games/20a/20aa03a10cda45239fe22d035c0ebe64.jpg","https://media.rawg.io/media/screenshots/a7c/a7c43871a54bed6573a6a429451564ef.jpg","https://media.rawg.io/media/screenshots/cf4/cf4367daf6a1e33684bf19adb02d16d6.jpg","https://media.rawg.io/media/screenshots/f95/f9518b1d99210c0cae21fc09e95b4e31.jpg","https://media.rawg.io/media/screenshots/a5c/a5c95ea539c87d5f538763e16e18fb99.jpg","https://media.rawg.io/media/screenshots/a7e/a7e990bc574f4d34e03b5926361d1ee7.jpg","https://media.rawg.io/media/screenshots/592/592e2501d8734b802b2a34fee2df59fa.jpg"]', '2024-05-18 18:56:48.26332', '2024-05-18 18:56:48.26332'),
//             (23, 'Mortal Kombat 1', 'WB Games', '2023-09-19', 'Prepare for the ultimate fighting experience in ''Mortal Kombat 11'', the latest installment in the acclaimed franchise. Enter the arena as iconic warriors from the Mortal Kombat universe and new challengers alike, each with their own arsenal of bone-crushing moves and fatalities. Engage in visceral combat across stunning arenas, utilizing new gameplay mechanics and customization options to dominate your opponents. With its cinematic story mode, intense multiplayer battles, and unparalleled gore, Mortal Kombat 11 delivers the definitive fighting game experience for fans old and new.', 'mortal-kombat-1-2023', 'https://media.rawg.io/media/games/155/155087d7b9c1225cda0ab9e586b6374d.jpg', '', 3.48, 78, '["https://media.rawg.io/media/games/155/155087d7b9c1225cda0ab9e586b6374d.jpg","https://media.rawg.io/media/screenshots/68f/68fe836ccd881479c4fa5542730581b0.jpg","https://media.rawg.io/media/screenshots/542/542579a2b5bde8c617a203b32be74d4f_ayR2HfE.jpg","https://media.rawg.io/media/screenshots/f2d/f2d8831f1b228168d687f4f3333072c8.jpg","https://media.rawg.io/media/screenshots/66c/66cde66706cce12dc645ae7d42a689d0.jpg","https://media.rawg.io/media/screenshots/bb6/bb6688a5a747e8a7f451ea72e634eb6f.jpg","https://media.rawg.io/media/screenshots/5be/5bed684907503ad9e5d75690b31b1041.jpg"]', '2024-05-18 18:57:46.252043', '2024-05-18 18:57:46.252043'),
//             (24, 'Crysis 3 Remastered', 'CryTech', '2021-10-17', 'Enter the urban jungle of a post-apocalyptic New York City in ''Crysis 3''. Equipped with the powerful Nanosuit, become Prophet, a supersoldier on a mission to uncover the truth behind the alien Ceph and the corrupt CELL Corporation. Utilize a vast arsenal of high-tech weaponry and advanced stealth tactics as you navigate through lush, overgrown environments. With stunning visuals, dynamic combat, and a gripping narrative, Crysis 3 delivers an unparalleled first-person shooter experience.', 'crysis-3-remastered', 'https://media.rawg.io/media/games/08e/08e30af061660c229d7480325fdf5f07.jpg', '', 3.45, 0, '["https://media.rawg.io/media/games/08e/08e30af061660c229d7480325fdf5f07.jpg","https://media.rawg.io/media/screenshots/52f/52f4fe35c9d475f70f36285df26fa414.jpg","https://media.rawg.io/media/screenshots/149/149797646e1152d79b77a52c9ebadf71.jpg","https://media.rawg.io/media/screenshots/1fc/1fc76de13c98b66c16158b57c34ab767.jpg","https://media.rawg.io/media/screenshots/2e7/2e7d14005065e085e6a9add43ae29925.jpg"]', '2024-05-18 19:10:42.55732', '2024-05-18 19:10:42.55732'),
//             (25, 'Grand Theft Auto: Vice City', 'Rockstar Games', '2002-10-27', 'Relive the 1980s in ''Grand Theft Auto: Vice City''. Step into the shoes of Tommy Vercetti, a former mobster navigating the vibrant, neon-lit streets of Vice City. Engage in a sprawling crime saga as you build your criminal empire, taking on missions filled with action, intrigue, and betrayal. With its iconic soundtrack, rich atmosphere, and expansive open world, Vice City offers a nostalgic and thrilling journey through the decadent, dangerous underworld of a fictional Miami.', 'grand-theft-auto-vice-city', 'https://media.rawg.io/media/games/13a/13a528ac9cf48bbb6be5d35fe029336d.jpg', '', 4.44, 94, '["https://media.rawg.io/media/games/13a/13a528ac9cf48bbb6be5d35fe029336d.jpg","https://media.rawg.io/media/screenshots/dfd/dfd73edec49df98ca9cd6736eeba1049.jpg","https://media.rawg.io/media/screenshots/41b/41bab662e69407ebdea4f9c2620ea964.jpg","https://media.rawg.io/media/screenshots/866/8669e298a904fce58ba84ab0a9205c01.jpg","https://media.rawg.io/media/screenshots/579/57946b3f520595bf96c77e9c36ea5a9a.jpg","https://media.rawg.io/media/screenshots/8d8/8d84dcd621ea9cc54ffec9ab6040f799.jpg","https://media.rawg.io/media/screenshots/bd2/bd2b4586b6acabf7ee39400d3ad5fa66.jpg"]', '2024-05-18 19:13:21.050258', '2024-05-18 19:13:21.050258'),
//             (26, 'Tomb Raider (2013)', 'Crystal Dynamics', '2013-03-05', 'Tomb Raider explores the intense and gritty origin story of Lara Croft and her ascent from a young woman to a hardened survivor. Armed only with raw instincts and the ability to push beyond the limits of human endurance, Lara must fight to unravel the dark history of a forgotten island to escape its relentless hold. Download the Turning Point trailer to see the beginning of Lara’s epic adventure.', 'tomb-raider', 'https://media.rawg.io/media/games/021/021c4e21a1824d2526f925eff6324653.jpg', '', 4.05, 86, '["https://media.rawg.io/media/games/021/021c4e21a1824d2526f925eff6324653.jpg","https://media.rawg.io/media/screenshots/4f9/4f9d5efdecfb63cb99f1baa4c0ceb3bf.jpg","https://media.rawg.io/media/screenshots/80f/80f373082b2a74da3f9c3fe2b877dcd0.jpg","https://media.rawg.io/media/screenshots/a87/a8733e877f8fbe45e4a727c22a06aa2e.jpg","https://media.rawg.io/media/screenshots/3f9/3f91678c6805a76419fa4ea3a045a909.jpg","https://media.rawg.io/media/screenshots/417/4170bf07be43a8d8249193883f87f1c1.jpg","https://media.rawg.io/media/screenshots/2a4/2a4250f83ad9e959d8b4ca9376ae34ea.jpg"]', '2024-05-19 22:07:17.664276', '2024-05-19 22:07:17.664276'),
//             (27, 'Assassin''s Creed Unity', 'Ubisoft', '2014-11-11', 'Assassin’s Creed® Unity is an action/adventure game set in the city of Paris during one of its darkest hours, the French Revolution. Take ownership of the story by customising Arno''s equipement to make the experience unique to you, both visually and mechanically. In addition to an epic single-player experience, Assassin’s Creed Unity delivers the excitement of playing with up to three friends through online cooperative gameplay in specific missions. Throughout the game, take part in one of the most pivotal moments of French history in a compelling storyline and a breath-taking playground that brought you the city of lights of today.', 'assassins-creed-unity-2', 'https://media.rawg.io/media/games/59f/59fc1c5de1d29cb9234741c97d250150.jpg', '', 4.75, 88, '["https://media.rawg.io/media/games/59f/59fc1c5de1d29cb9234741c97d250150.jpg","https://media.rawg.io/media/screenshots/bd3/bd3302a08d8c9ffbb73ffd4cd40714aa.jpg","https://media.rawg.io/media/screenshots/bd8/bd84c249c0629a21eb100e9f85741af4.jpg","https://media.rawg.io/media/screenshots/896/896a031eff2e03dc483e2c72c9709457.jpg","https://media.rawg.io/media/screenshots/8b1/8b189e10ce9c9276d052ee5cb04ff4b8.jpg","https://media.rawg.io/media/screenshots/5e0/5e076dd9935da9e829a2508ee1e64d18.jpg","https://media.rawg.io/media/screenshots/192/192e78d96471392a05fef86dbc13a7d1.jpg"]', '2024-05-20 00:30:07.67397', '2024-05-20 00:33:21.938214'),
//             (28, 'Sekiro: Shadows Die Twice', 'FromSoftware', '2019-03-22', 'Explore late 1500s Sengoku Japan, a brutal period of constant life and death conflict, as you come face to face with larger than life foes in a dark and twisted world. Unleash an arsenal of deadly prosthetic tools and powerful ninja abilities while you blend stealth, vertical traversal, and visceral head to head combat in a bloody confrontation.', 'shadows-die-twice', 'https://media.rawg.io/media/games/67f/67f62d1f062a6164f57575e0604ee9f6.jpg', '', 4.38, 90, '["https://media.rawg.io/media/games/67f/67f62d1f062a6164f57575e0604ee9f6.jpg","https://media.rawg.io/media/screenshots/198/198257c08163153e72a31bd61a6cd70b.jpg","https://media.rawg.io/media/screenshots/9b3/9b3add83516f3737b8054c7469be282a.jpg","https://media.rawg.io/media/screenshots/64d/64d71a80b0033e091b35c3948046605b.jpg","https://media.rawg.io/media/screenshots/8d7/8d77b08c45b3232961b443677fa06a5f.jpg","https://media.rawg.io/media/screenshots/a96/a96e960d87fc209488ef25da79b92a84.jpg","https://media.rawg.io/media/screenshots/8ed/8edc8d65ba1c1ab001a3fb1bd6fdeeb6.jpg"]', '2024-05-20 01:25:53.112506', '2024-05-20 01:25:53.112506');




// (1, 'Resident Evil 4', 'Capcom', '2023-03-24', '"Resident Evil 4" thrusts players into a nightmarish world of survival horror as Leon S. Kennedy, tasked with rescuing the President''s daughter from a sinister cult in rural Europe. With its groundbreaking third-person perspective, intense action, and atmospheric environments, Resident Evil 4 revolutionized the survival horror genre. Navigate through intricate puzzles, confront grotesque creatures, and unravel a chilling conspiracy in this iconic installment of the acclaimed ', 'resident-evil-4-2023', 'https://media.rawg.io/media/games/51a/51a404b9918a0b19fc704a3ca248c69f.jpg', '', 4.61, 94, '["https://media.rawg.io/media/games/51a/51a404b9918a0b19fc704a3ca248c69f.jpg","https://media.rawg.io/media/screenshots/33d/33dbe045a82988878cd865b80fcc6269.jpg","https://media.rawg.io/media/screenshots/cdd/cdd81f8b87c0352e20ab9f8eefba7ddb.jpg","https://media.rawg.io/media/screenshots/a73/a739f3814e9d57228bd6cdd406012911.jpg","https://media.rawg.io/media/screenshots/44a/44a9d54fefbef2e21e6b3b8c1c54546b.jpg"]', '2024-05-12 05:00:34.812722', '2024-05-19 22:02:40.627984'),
// (2, 'The Last of Us Part II', 'Naughty Dog', '2020-06-19', '"The Last of Us Part II" immerses players in a post-apocalyptic world fraught with peril and moral ambiguity. Navigate through the ruins of civilization as Ellie, confronting both the infected and human adversaries alike. With its gripping narrative, visceral combat, and stunning visuals, TLOU 2 delivers an emotionally resonant journey that challenges your perceptions of right and wrong in a world consumed by darkness.', 'the-last-of-us-part-2', 'https://media.rawg.io/media/games/909/909974d1c7863c2027241e265fe7011f.jpg', 'https://youtu.be/btmN-bWwv0A?si=oQgTW3OFx87Kprom', 5.00, 93, '["https://media.rawg.io/media/games/909/909974d1c7863c2027241e265fe7011f.jpg","https://media.rawg.io/media/screenshots/5a8/5a8f06949b0264aa27374d3f005a2842.jpg","https://media.rawg.io/media/screenshots/160/1603055e1fc4fbbea395809242d23c67_CDpXDx3.jpg","https://media.rawg.io/media/screenshots/e9c/e9cfbbc7821827e04c890ecf087c246c.jpg","https://media.rawg.io/media/screenshots/e58/e58f17219570ca451356f6eec746e697.jpg","https://media.rawg.io/media/screenshots/02a/02aede3e5e6738e37ff1240c1c2fcee8.jpg","https://media.rawg.io/media/screenshots/5ea/5ea913f25ebb5454571e8d92deddebcc.jpg"]', '2024-05-12 05:01:50.58585', '2024-05-17 21:35:13.711893'),
// (3, 'Resident Evil 2', 'Capcom', '2019-01-25', 'Resident Evil 2" immerses players in the heart of Raccoon City, overrun by hordes of zombies and other terrifying creatures unleashed by the deadly T-virus. Play as rookie cop Leon Kennedy or college student Claire Redfield as they fight for survival and uncover the dark secrets of the Umbrella Corporation. With its tense atmosphere, strategic gameplay, and immersive storytelling, Resident Evil 2 delivers an unforgettable survival horror experience that redefined the genre.', 'resident-evil-2-2019', 'https://media.rawg.io/media/games/053/053fc543bf488349610f1ae2d0c1b51b.jpg', '', 4.50, 91, '["https://media.rawg.io/media/games/053/053fc543bf488349610f1ae2d0c1b51b.jpg","https://media.rawg.io/media/screenshots/9e6/9e6e83b37dfd176eab77a829c5c7a109.jpg","https://media.rawg.io/media/screenshots/ca6/ca6629a8a4565b8ae7816ffcb4d38657.jpg","https://media.rawg.io/media/screenshots/df4/df450d260b14fb77ac238d77fe98746d.jpg","https://media.rawg.io/media/screenshots/fac/facb42731a6cc48e8fdfaef995f3ed71.jpg","https://media.rawg.io/media/screenshots/4bf/4bf2b3c6822715ec3b01882e0cf97572.jpg","https://media.rawg.io/media/screenshots/bdb/bdbf60136aad78a718679d2f1ac317f9.jpg"]', '2024-05-12 05:02:32.352482', '2024-05-12 05:02:32.352482'),
// (4, 'Uncharted 4: A Thief’s End', 'Naughty Dog', '2016-05-10', '"Uncharted 4: A Thief''s End" takes players on a thrilling adventure across exotic landscapes and treacherous terrain. Join Nathan Drake on his final quest as he delves into the mysteries of his past and confronts his greatest challenge yet. With its breathtaking visuals, exhilarating action sequences, and compelling storytelling, Uncharted 4 delivers an unforgettable journey filled with danger, discovery, and redemption.', 'uncharted-4-a-thiefs-end', 'https://media.rawg.io/media/games/709/709bf81f874ce5d25d625b37b014cb63.jpg', '', 4.51, 99, '["https://media.rawg.io/media/games/709/709bf81f874ce5d25d625b37b014cb63.jpg","https://media.rawg.io/media/screenshots/fd5/fd5451e27048c3e416de1737047e4684.jpg","https://media.rawg.io/media/screenshots/63f/63f551c55bb44ec41dbcab6898cdd264.jpg","https://media.rawg.io/media/screenshots/30b/30bfd42d8bfe46301dbef56ba526b3ed.jpg","https://media.rawg.io/media/screenshots/fd2/fd2ae2bc22f4fefeeb6f4b6f1587e128.jpg","https://media.rawg.io/media/screenshots/66c/66c2aecdd80e940ea7a2d64c17cff843.jpg","https://media.rawg.io/media/screenshots/89c/89c96f28e032d3434bab7b9247e01fe3.jpg"]', '2024-05-12 05:03:19.018575', '2024-05-17 21:35:59.851093'),
// (5, 'Hitman', 'IOI Interactive', '2016-03-11', '"Hitman" puts players in the sleek shoes of Agent 47, a professional assassin navigating a world of intrigue and deception. With its sandbox-style levels and emphasis on creativity, players can approach each mission with their own style and strategy. Whether you prefer stealthy takedowns or all-out action, Hitman offers a thrilling and immersive experience that will test your skills as the ultimate contract killer.', 'hitman', 'https://media.rawg.io/media/games/16b/16b1b7b36e2042d1128d5a3e852b3b2f.jpg', '', 3.92, 83, '["https://media.rawg.io/media/games/16b/16b1b7b36e2042d1128d5a3e852b3b2f.jpg","https://media.rawg.io/media/screenshots/ef6/ef6c0a92d08a99d2e405cac53c597d10.jpg","https://media.rawg.io/media/screenshots/fb3/fb3c23014fcb24a28fb94af0a009906c.jpg","https://media.rawg.io/media/screenshots/202/202293192d1b6245c8a1e252d9df604c.jpg","https://media.rawg.io/media/screenshots/278/278bd63ee564982e816ec7fe802df420.jpg","https://media.rawg.io/media/screenshots/002/0021b0e5db6959989d90979abba68c8d.jpg","https://media.rawg.io/media/screenshots/c8a/c8a537532ab8ce8750293a1fc41ee7f8.jpg"]', '2024-05-12 05:03:51.74247', '2024-05-12 05:03:51.74247'),
// (6, 'God of War (2018)', 'SantaMonica Studio', '2018-04-20', 'Unleash the fury of Kratos in ''God of War'' (2018), a breathtaking reimagining of the iconic series. Journey alongside Kratos and his son Atreus through the treacherous realms of Norse mythology, as they embark on a deeply personal quest. With stunning visuals, immersive storytelling, and brutal combat, experience the epic tale of a father and son bound by tragedy, seeking redemption in a world teetering on the brink of chaos.', 'god-of-war-2', 'https://media.rawg.io/media/games/4be/4be6a6ad0364751a96229c56bf69be59.jpg', '', 4.56, 94, '["https://media.rawg.io/media/games/4be/4be6a6ad0364751a96229c56bf69be59.jpg","https://media.rawg.io/media/screenshots/d68/d6868e5f7bce66e326bd48b11ba24b13.jpeg","https://media.rawg.io/media/screenshots/928/928cdaf4ae204f202d177bbd65e911b3.jpeg","https://media.rawg.io/media/screenshots/a54/a549a06ebe89c570cabb57308c4c42a5.jpeg","https://media.rawg.io/media/screenshots/f02/f0279f8199da3e91134078e737e5fbcf.jpg","https://media.rawg.io/media/screenshots/e87/e87c57660c7c37fe973c6dd6ebcc1ac6.jpeg","https://media.rawg.io/media/screenshots/5b7/5b7280fe437c39d3ce501a867c46a998.jpeg"]', '2024-05-13 18:16:41.173285', '2024-05-13 18:16:41.173285'),
// (7, 'Star Wars Jedi: Fallen Order', ' Electronic Arts', '2019-11-15', 'A galaxy-spanning adventure awaits in Star Wars Jedi: Fallen Order, a new third-person action-adventure title from Respawn Entertainment. This narratively driven, single-player game puts you in the role of a Jedi Padawan who narrowly escaped the purge of Order 66 following the events of Episode 3: Revenge of the Sith. On a quest to rebuild the Jedi Order, you must pick up the pieces of your shattered past to complete your training, develop new powerful Force abilities and master the art of the iconic lightsaber - all while staying one step ahead of the Empire and its deadly Inquisitors.', 'jedi-the-fallen-order', 'https://media.rawg.io/media/games/559/559bc0768f656ad0c63c54b80a82d680.jpg', '', 4.14, 80, '["https://media.rawg.io/media/games/559/559bc0768f656ad0c63c54b80a82d680.jpg","https://media.rawg.io/media/screenshots/1c0/1c0016ec0441e86648bd7f751c8e5adf.jpg","https://media.rawg.io/media/screenshots/4fd/4fd551e67bc9fd9eb4c855604838d10f.jpg","https://media.rawg.io/media/screenshots/dd6/dd69cc02ef3d56dabbe62f06ddea8569.jpg","https://media.rawg.io/media/screenshots/b2c/b2cdb1843349dd5db358a4b214a00f2c.jpg","https://media.rawg.io/media/screenshots/c60/c6065f618a7304016db7fa02d563084a_rSIdAmV.jpg","https://media.rawg.io/media/screenshots/99f/99f9710b7305817f44866b7a61b77dd0.jpg"]', '2024-05-16 03:53:24.538537', '2024-05-16 03:53:24.538537'),
// (8, 'Cyberpunk 2077', 'CD ProjectsRed', '2020-12-10', 'Dive into the neon-lit streets of Night City in ''Cyberpunk 2077'', a sprawling open-world RPG set in a dystopian future. Play as V, a mercenary outlaw equipped with cybernetic enhancements, as you navigate a city filled with violence, intrigue, and opportunity. Customize your character''s appearance, abilities, and playstyle as you forge alliances, take on missions, and uncover the dark secrets lurking beneath the surface. With its deep narrative, immersive world-building, and stunning visuals, Cyberpunk 2077 offers an unforgettable journey into the heart of cyberpunk fiction.', 'cyberpunk-2077', 'https://media.rawg.io/media/games/26d/26d4437715bee60138dab4a7c8c59c92.jpg', '', 4.17, 73, '["https://media.rawg.io/media/games/26d/26d4437715bee60138dab4a7c8c59c92.jpg","https://media.rawg.io/media/screenshots/814/814c25d6fd1fd34a4e6dade645a3bda7.jpg","https://media.rawg.io/media/screenshots/2ab/2ab0b67e68b6ede6b19d80094b6f7f2a_qTSfS2g.jpg","https://media.rawg.io/media/screenshots/cd2/cd22af9d6ac593440defac6082760e4a.jpg","https://media.rawg.io/media/screenshots/9b5/9b51535beb9d9e416cb9aac874091334.jpg","https://media.rawg.io/media/screenshots/d84/d84d3a16c1e2cb24dcf73e0108d78455.jpg","https://media.rawg.io/media/screenshots/a55/a5583c11e4fd11a9eb5d52e8ddd41ac3.jpg"]', '2024-05-17 20:35:42.108901', '2024-05-17 20:35:42.108901'),
// (9, 'Batman: Arkham Knight', 'WB Games', '2015-06-23', 'Join the Dark Knight in his final chapter as Gotham faces its greatest threat in ''Batman: Arkham Knight''. Take to the streets of a besieged Gotham City, where Scarecrow and the mysterious Arkham Knight wreak havoc. Utilize the Batmobile and Batman''s formidable combat skills to overcome adversaries and unravel the sinister plot threatening the city. With stunning visuals, immersive gameplay, and a gripping narrative, Arkham Knight delivers the ultimate Batman experience."', 'batman-arkham-knight', 'https://media.rawg.io/media/games/310/3106b0e012271c5ffb16497b070be739.jpg', '', 4.24, 81, '["https://media.rawg.io/media/games/310/3106b0e012271c5ffb16497b070be739.jpg","https://media.rawg.io/media/screenshots/1ed/1ed7f33789fdb79dbe7ae346f7b24fdf.jpg","https://media.rawg.io/media/screenshots/c19/c19a4d55f1fa9661b32d43e110a5dbff.jpg","https://media.rawg.io/media/screenshots/b87/b873d09e51115514cb1445a954dbca9e.jpg","https://media.rawg.io/media/screenshots/cbe/cbee51d83cafbe75224336859ddfc27e.jpg","https://media.rawg.io/media/screenshots/d2a/d2ab2d0f10e778c1a867c999515c3f9a.jpg","https://media.rawg.io/media/screenshots/172/172a4d61d4b6d3b77f19f5826de439f2.jpg"]', '2024-05-17 20:36:31.842608', '2024-05-17 20:36:31.842608'),
// (10, 'Assassin''s Creed Valhalla', 'Ubisoft', '2020-11-10', 'Embark on a legendary Viking journey in ''Assassin''s Creed Valhalla''. Play as Eivor, a fierce Viking raider, as you lead your clan from the harsh shores of Norway to the lush lands of ninth-century England. Forge alliances, build your settlement, and conquer territories in an expansive open world filled with dynamic quests and brutal combat. With rich storytelling, stunning visuals, and deep customization, Valhalla immerses you in the epic saga of Viking warfare and exploration.', 'assassins-creed-valhalla', 'https://media.rawg.io/media/games/934/9346092ae11bf7582c883869468171cc.jpg', '', 3.72, 82, '["https://media.rawg.io/media/games/934/9346092ae11bf7582c883869468171cc.jpg","https://media.rawg.io/media/screenshots/40d/40d4c5e37758450905c985918ab6ea11.jpg","https://media.rawg.io/media/screenshots/c5b/c5b052449f59eb31a0dcf01967d0715b.jpg","https://media.rawg.io/media/screenshots/0fa/0fab0247d40f79a2f35fe8143dc438ec.jpg","https://media.rawg.io/media/screenshots/50e/50efcd7fdd2967ddd73c9911985339dc.jpg","https://media.rawg.io/media/screenshots/4c4/4c4e1c1079b11760d07847f83cc1a2a8.jpg","https://media.rawg.io/media/screenshots/a07/a07f4c2dab611d69357f20f32435b1a2.jpg"]', '2024-05-17 21:30:41.212567', '2024-05-17 21:30:41.212567'),
// (11, 'Assassin''s Creed Syndicate', 'Ubisoft', '2015-10-13', 'Take back the streets of Industrial Revolution-era London in ''Assassin''s Creed Syndicate''. Play as twin Assassins, Jacob and Evie Frye, as you fight to liberate the city from the grip of the Templars. Navigate the gritty urban landscape using advanced parkour, engage in dynamic combat, and lead your gang to overthrow corrupt officials. With its rich historical setting, diverse gameplay mechanics, and compelling narrative, Syndicate delivers a thrilling adventure in the heart of Victorian London.', 'assassins-creed-syndicate-2', 'https://media.rawg.io/media/games/9f1/9f189c639f70f91166df415811a8b525.jpg', '', 3.67, 74, '["https://media.rawg.io/media/games/9f1/9f189c639f70f91166df415811a8b525.jpg","https://media.rawg.io/media/screenshots/578/57836521fc9d7f0a5b743c5d3aabbac2.jpg","https://media.rawg.io/media/screenshots/240/2402b360498dc27ac594774a968e028f.jpg","https://media.rawg.io/media/screenshots/cdd/cdda74e097646eda1ae8c87c46942530.jpg","https://media.rawg.io/media/screenshots/6cb/6cb68bc408c6c0e4e0f1b2782ad03e86.jpg","https://media.rawg.io/media/screenshots/b90/b909dc646a468a33b1a5e9d97fb2b979.jpg","https://media.rawg.io/media/screenshots/82f/82fe6e74ec918f4c7c0df69cd991a04b.jpg"]', '2024-05-17 21:31:18.326549', '2024-05-17 21:36:25.654406'),
// (12, 'Syberia: The World Before', 'Microids Studio', '2022-03-18', 'Embark on an enchanting journey in ''Syberia: The World Before''. Follow the intertwined destinies of Kate Walker and Dana Roze across different eras as you explore stunning landscapes and unravel intricate puzzles. Set against the backdrop of war and mystery, immerse yourself in a rich narrative filled with emotional depth and captivating characters. With its beautiful artistry and engaging gameplay, Syberia: The World Before offers an unforgettable adventure through time and imagination.', 'syberia-the-world-before', 'https://media.rawg.io/media/games/067/067df4bb30f618958ffc58ad8e3b0a38.jpg', '', 3.92, 80, '["https://media.rawg.io/media/games/067/067df4bb30f618958ffc58ad8e3b0a38.jpg","https://media.rawg.io/media/screenshots/fcd/fcda2519866ca4a0ed131c72ff58cb54.jpg","https://media.rawg.io/media/screenshots/6a9/6a94b81097b01559e779b9b15a7a4cf6.jpg","https://media.rawg.io/media/screenshots/00d/00d88a509b836e73b95799efdec54cb9.jpg","https://media.rawg.io/media/screenshots/c4c/c4c4ce8f231a250e3687b372cb8b5b80.jpg","https://media.rawg.io/media/screenshots/76a/76a05911b4335eeae49f5435f3dc5369.jpg","https://media.rawg.io/media/screenshots/f47/f47a0af6c29929ec055dc04ef4244f7e.jpg"]', '2024-05-18 18:52:18.015886', '2024-05-18 18:52:18.015886'),
// (13, 'Grand Theft Auto V', 'RockStar', '2013-09-17', 'Experience the sprawling open world of Los Santos in ''Grand Theft Auto V''. Play as three distinct characters—Michael, Franklin, and Trevor—as their lives intertwine in a series of daring heists and explosive missions. Explore a vibrant city filled with diverse activities, from high-speed chases and heists to golfing and stock trading. With its engaging storyline, vast open world, and extensive multiplayer mode, GTA V offers an unparalleled gaming experience of crime and chaos.', 'grand-theft-auto-v', 'https://media.rawg.io/media/games/20a/20aa03a10cda45239fe22d035c0ebe64.jpg', '', 4.47, 92, '["https://media.rawg.io/media/games/20a/20aa03a10cda45239fe22d035c0ebe64.jpg","https://media.rawg.io/media/screenshots/a7c/a7c43871a54bed6573a6a429451564ef.jpg","https://media.rawg.io/media/screenshots/cf4/cf4367daf6a1e33684bf19adb02d16d6.jpg","https://media.rawg.io/media/screenshots/f95/f9518b1d99210c0cae21fc09e95b4e31.jpg","https://media.rawg.io/media/screenshots/a5c/a5c95ea539c87d5f538763e16e18fb99.jpg","https://media.rawg.io/media/screenshots/a7e/a7e990bc574f4d34e03b5926361d1ee7.jpg","https://media.rawg.io/media/screenshots/592/592e2501d8734b802b2a34fee2df59fa.jpg"]', '2024-05-18 18:56:48.26332', '2024-05-18 18:56:48.26332'),
// (14, 'Mortal Kombat 1', 'WB Games', '2023-09-19', 'Prepare for the ultimate fighting experience in ''Mortal Kombat 11'', the latest installment in the acclaimed franchise. Enter the arena as iconic warriors from the Mortal Kombat universe and new challengers alike, each with their own arsenal of bone-crushing moves and fatalities. Engage in visceral combat across stunning arenas, utilizing new gameplay mechanics and customization options to dominate your opponents. With its cinematic story mode, intense multiplayer battles, and unparalleled gore, Mortal Kombat 11 delivers the definitive fighting game experience for fans old and new.', 'mortal-kombat-1-2023', 'https://media.rawg.io/media/games/155/155087d7b9c1225cda0ab9e586b6374d.jpg', '', 3.48, 78, '["https://media.rawg.io/media/games/155/155087d7b9c1225cda0ab9e586b6374d.jpg","https://media.rawg.io/media/screenshots/68f/68fe836ccd881479c4fa5542730581b0.jpg","https://media.rawg.io/media/screenshots/542/542579a2b5bde8c617a203b32be74d4f_ayR2HfE.jpg","https://media.rawg.io/media/screenshots/f2d/f2d8831f1b228168d687f4f3333072c8.jpg","https://media.rawg.io/media/screenshots/66c/66cde66706cce12dc645ae7d42a689d0.jpg","https://media.rawg.io/media/screenshots/bb6/bb6688a5a747e8a7f451ea72e634eb6f.jpg","https://media.rawg.io/media/screenshots/5be/5bed684907503ad9e5d75690b31b1041.jpg"]', '2024-05-18 18:57:46.252043', '2024-05-18 18:57:46.252043'),
// (15, 'Crysis 3 Remastered', 'CryTech', '2021-10-17', 'Enter the urban jungle of a post-apocalyptic New York City in ''Crysis 3''. Equipped with the powerful Nanosuit, become Prophet, a supersoldier on a mission to uncover the truth behind the alien Ceph and the corrupt CELL Corporation. Utilize a vast arsenal of high-tech weaponry and advanced stealth tactics as you navigate through lush, overgrown environments. With stunning visuals, dynamic combat, and a gripping narrative, Crysis 3 delivers an unparalleled first-person shooter experience.', 'crysis-3-remastered', 'https://media.rawg.io/media/games/08e/08e30af061660c229d7480325fdf5f07.jpg', '', 3.45, 0, '["https://media.rawg.io/media/games/08e/08e30af061660c229d7480325fdf5f07.jpg","https://media.rawg.io/media/screenshots/52f/52f4fe35c9d475f70f36285df26fa414.jpg","https://media.rawg.io/media/screenshots/149/149797646e1152d79b77a52c9ebadf71.jpg","https://media.rawg.io/media/screenshots/1fc/1fc76de13c98b66c16158b57c34ab767.jpg","https://media.rawg.io/media/screenshots/2e7/2e7d14005065e085e6a9add43ae29925.jpg"]', '2024-05-18 19:10:42.55732', '2024-05-18 19:10:42.55732'),
// (16, 'Grand Theft Auto: Vice City', 'Rockstar Games', '2002-10-27', 'Relive the 1980s in ''Grand Theft Auto: Vice City''. Step into the shoes of Tommy Vercetti, a former mobster navigating the vibrant, neon-lit streets of Vice City. Engage in a sprawling crime saga as you build your criminal empire, taking on missions filled with action, intrigue, and betrayal. With its iconic soundtrack, rich atmosphere, and expansive open world, Vice City offers a nostalgic and thrilling journey through the decadent, dangerous underworld of a fictional Miami.', 'grand-theft-auto-vice-city', 'https://media.rawg.io/media/games/13a/13a528ac9cf48bbb6be5d35fe029336d.jpg', '', 4.44, 94, '["https://media.rawg.io/media/games/13a/13a528ac9cf48bbb6be5d35fe029336d.jpg","https://media.rawg.io/media/screenshots/dfd/dfd73edec49df98ca9cd6736eeba1049.jpg","https://media.rawg.io/media/screenshots/41b/41bab662e69407ebdea4f9c2620ea964.jpg","https://media.rawg.io/media/screenshots/866/8669e298a904fce58ba84ab0a9205c01.jpg","https://media.rawg.io/media/screenshots/579/57946b3f520595bf96c77e9c36ea5a9a.jpg","https://media.rawg.io/media/screenshots/8d8/8d84dcd621ea9cc54ffec9ab6040f799.jpg","https://media.rawg.io/media/screenshots/bd2/bd2b4586b6acabf7ee39400d3ad5fa66.jpg"]', '2024-05-18 19:13:21.050258', '2024-05-18 19:13:21.050258'),
// (17, 'Tomb Raider (2013)', 'Crystal Dynamics', '2013-03-05', 'Tomb Raider explores the intense and gritty origin story of Lara Croft and her ascent from a young woman to a hardened survivor. Armed only with raw instincts and the ability to push beyond the limits of human endurance, Lara must fight to unravel the dark history of a forgotten island to escape its relentless hold. Download the Turning Point trailer to see the beginning of Lara’s epic adventure.', 'tomb-raider', 'https://media.rawg.io/media/games/021/021c4e21a1824d2526f925eff6324653.jpg', '', 4.05, 86, '["https://media.rawg.io/media/games/021/021c4e21a1824d2526f925eff6324653.jpg","https://media.rawg.io/media/screenshots/4f9/4f9d5efdecfb63cb99f1baa4c0ceb3bf.jpg","https://media.rawg.io/media/screenshots/80f/80f373082b2a74da3f9c3fe2b877dcd0.jpg","https://media.rawg.io/media/screenshots/a87/a8733e877f8fbe45e4a727c22a06aa2e.jpg","https://media.rawg.io/media/screenshots/3f9/3f91678c6805a76419fa4ea3a045a909.jpg","https://media.rawg.io/media/screenshots/417/4170bf07be43a8d8249193883f87f1c1.jpg","https://media.rawg.io/media/screenshots/2a4/2a4250f83ad9e959d8b4ca9376ae34ea.jpg"]', '2024-05-19 22:07:17.664276', '2024-05-19 22:07:17.664276'),
// (18, 'Assassin''s Creed Unity', 'Ubisoft', '2014-11-11', 'Assassin’s Creed® Unity is an action/adventure game set in the city of Paris during one of its darkest hours, the French Revolution. Take ownership of the story by customising Arno''s equipement to make the experience unique to you, both visually and mechanically. In addition to an epic single-player experience, Assassin’s Creed Unity delivers the excitement of playing with up to three friends through online cooperative gameplay in specific missions. Throughout the game, take part in one of the most pivotal moments of French history in a compelling storyline and a breath-taking playground that brought you the city of lights of today.', 'assassins-creed-unity-2', 'https://media.rawg.io/media/games/59f/59fc1c5de1d29cb9234741c97d250150.jpg', '', 4.75, 88, '["https://media.rawg.io/media/games/59f/59fc1c5de1d29cb9234741c97d250150.jpg","https://media.rawg.io/media/screenshots/bd3/bd3302a08d8c9ffbb73ffd4cd40714aa.jpg","https://media.rawg.io/media/screenshots/bd8/bd84c249c0629a21eb100e9f85741af4.jpg","https://media.rawg.io/media/screenshots/896/896a031eff2e03dc483e2c72c9709457.jpg","https://media.rawg.io/media/screenshots/8b1/8b189e10ce9c9276d052ee5cb04ff4b8.jpg","https://media.rawg.io/media/screenshots/5e0/5e076dd9935da9e829a2508ee1e64d18.jpg","https://media.rawg.io/media/screenshots/192/192e78d96471392a05fef86dbc13a7d1.jpg"]', '2024-05-20 00:30:07.67397', '2024-05-20 00:33:21.938214'),
// (19, 'Sekiro: Shadows Die Twice', 'FromSoftware', '2019-03-22', 'Explore late 1500s Sengoku Japan, a brutal period of constant life and death conflict, as you come face to face with larger than life foes in a dark and twisted world. Unleash an arsenal of deadly prosthetic tools and powerful ninja abilities while you blend stealth, vertical traversal, and visceral head to head combat in a bloody confrontation.', 'shadows-die-twice', 'https://media.rawg.io/media/games/67f/67f62d1f062a6164f57575e0604ee9f6.jpg', '', 4.38, 90, '["https://media.rawg.io/media/games/67f/67f62d1f062a6164f57575e0604ee9f6.jpg","https://media.rawg.io/media/screenshots/198/198257c08163153e72a31bd61a6cd70b.jpg","https://media.rawg.io/media/screenshots/9b3/9b3add83516f3737b8054c7469be282a.jpg","https://media.rawg.io/media/screenshots/64d/64d71a80b0033e091b35c3948046605b.jpg","https://media.rawg.io/media/screenshots/8d7/8d77b08c45b3232961b443677fa06a5f.jpg","https://media.rawg.io/media/screenshots/a96/a96e960d87fc209488ef25da79b92a84.jpg","https://media.rawg.io/media/screenshots/8ed/8edc8d65ba1c1ab001a3fb1bd6fdeeb6.jpg"]', '2024-05-20 01:25:53.112506', '2024-05-20 01:25:53.112506');